import React from "react";
import Items from "./Items";

export default function MainWindow(props) {
  const title = props.title,
        items = props.items;

  return (
    <section>
      <h2>{title}</h2>
      {items
        ? items.map((item) => {
            <Items item={item}/>
          })
        : console.log("loading")}
    </section>
  );
}
